(5, 'Selling', 1, '2015-12-04 22:23:02', 1, 0, 'auto-parts-selling', '<p><span style="font-size: 18px;">Welcome to the Sellers list!&nbsp;</span></p><p><span style="letter-spacing: 0.1px; font-size: 18px;">Now what are you waiting for?&nbsp;</span><span style="letter-spacing: 0.1px; line-height: 1.846; font-size: 18px;">Make sure you contact a seller to get what you need before someone else does!</span></p><p><span style="letter-spacing: 0.1px; line-height: 26.6644px;">Use the sorting tool to help find your desired results faster -- categorizable by distance, name(A-Z), price, favorites, featured ads, and date.</span></p><p><span style="letter-spacing: 0.1px; line-height: 26.6644px;">Click on the globe to expand the Parts Map and see all the nearest sellers to you!</span><br></p><p><br></p>', '0.00', NULL, 0),
(26, 'Parts Needed', 1, '2015-12-04 22:23:34', 1, 0, 'auto-parts-2', '<p><span style="font-size: 18px;">Don''t want to wait for a buyer to contact you? Here you can see a full list of all parts in need.</span></p><p><span style="letter-spacing: 0.1px; line-height: 26.6644px;">Use the sorting tool to help find your desired results faster -- categorizable by distance, name(A-Z), price, favorites, featured ads, and date.</span></p><p><span style="letter-spacing: 0.1px; line-height: 26.6644px;">Click on the globe to expand the Parts Map and see all the nearest buyers near you!</span><span style="letter-spacing: 0.1px; line-height: 26.6644px;"><br></span><br></p>', '0.00', NULL, 0);
