INSERT INTO `oc_content` VALUES
(1, 'en_UK', 0, 'Change Password [SITE.NAME]', 'auth-remember', 'Hello [USER.NAME],\n\nFollow this link  [URL.QL]\n\nThanks!!', 'drrrreams@gmail.com', '2015-11-30 15:53:50', 'email', 1),
(2, 'en_UK', 0, 'Welcome to [SITE.NAME]!', 'auth-register', 'Welcome [USER.NAME],\n\nWe are really happy that you have joined us! [URL.QL]\n\nRemember your user details:\nEmail: [USER.EMAIL]\nPassword: [USER.PWD]\n\nWe do not have your original password anymore.\n\nRegards!', 'drrrreams@gmail.com', '2015-11-30 15:53:50', 'email', 1),
(3, 'en_UK', 0, 'Hello [USER.NAME]!', 'user-contact', 'You have been contacted regarding your advertisement: \n\n`[AD.NAME]`. \n\n User [EMAIL.SENDER] [EMAIL.FROM], have a message for you: \n\n[EMAIL.BODY]. \n\nYou can check your advertisement by following this link [URL.AD]\n\n Regards!', 'drrrreams@gmail.com', '2015-11-30 15:53:50', 'email', 1),
(4, 'en_UK', 0, 'Hello [USER.NAME]!', 'user-profile-contact', 'User [EMAIL.SENDER] [EMAIL.FROM], have a message for you: \n\n[EMAIL.SUBJECT] \n\n[EMAIL.BODY]. \n\n Regards!', 'drrrreams@gmail.com', '2015-11-30 15:53:50', 'email', 1),
(5, 'en_UK', 0, '[EMAIL.SENDER] wants to contact you!', 'contact-admin', 'Hello Admin,\n\n [EMAIL.SENDER]: [EMAIL.FROM], have a message for you:\n\n [EMAIL.BODY] \n\n Regards!', 'drrrreams@gmail.com', '2015-11-30 15:53:50', 'email', 1),
(6, 'en_UK', 0, 'Your advertisement `[AD.NAME]` at [SITE.NAME], has been activated!', 'ads-activated', 'Hello [USER.OWNER],\n\n We want to inform you that your advertisement [URL.QL] has been activated!\n\n Now it can be seen by others. \n\n We hope we did not make you wait for long. \n\nRegards!', 'drrrreams@gmail.com', '2015-11-30 15:53:50', 'email', 1),
(7, 'en_UK', 0, 'Success! Your advertisement `[AD.NAME]` is created on [SITE.NAME]!', 'ads-notify', 'Hello [USER.NAME],\n\nThank you for creating an advertisement at [SITE.NAME]! \n\nYou can edit your advertisement here [URL.QL].\n\n Your ad is still not published, it needs to be validated by an administrator. \n\n We are sorry for any inconvenience. We will review it as soon as possible. \n\nRegards!', 'drrrreams@gmail.com', '2015-11-30 15:53:50', 'email', 1),
(8, 'en_UK', 0, 'Advertisement `[AD.NAME]` is created on [SITE.NAME]!', 'ads-user-check', 'Hello [USER.NAME],\n\n Advertisement is created under your account [USER.NAME]! You can visit this link to see advertisement [URL.AD]\n\n If you are not responsible for creating this advertisement, click a link to contact us [URL.CONTACT].\n\n', 'drrrreams@gmail.com', '2015-11-30 15:53:50', 'email', 1),
(9, 'en_UK', 0, 'Advertisement `[AD.TITLE]` is created on [SITE.NAME]!', 'ads-subscribers', 'Hello,\n\n You may be interested in this one!\n\nYou can visit this link to see advertisement [URL.AD]\n\n', 'drrrreams@gmail.com', '2015-11-30 15:53:50', 'email', 1),
(10, 'en_UK', 0, 'Advertisement `[AD.TITLE]` is created on [SITE.NAME]!', 'ads-to-admin', 'Click here to visit [URL.AD]', 'drrrreams@gmail.com', '2015-11-30 15:53:50', 'email', 1),
(11, 'en_UK', 0, 'Advertisement `[AD.TITLE]` is sold on [SITE.NAME]!', 'ads-sold', 'Order ID: [ORDER.ID]\n\nProduct ID: [PRODUCT.ID]\n\nPlease check your account for the incoming payment.\n\nClick here to visit [URL.AD]', 'drrrreams@gmail.com', '2015-11-30 15:53:50', 'email', 1),
(12, 'en_UK', 0, 'Advertisement `[AD.TITLE]` is out of stock on [SITE.NAME]!', 'out-of-stock', 'Hello [USER.NAME],\n\nWhile your ad is out of stock, it is unavailable for others to see. If you wish to increase stock and activate, please follow this link [URL.EDIT].\n\nRegards!', 'drrrreams@gmail.com', '2015-11-30 15:53:50', 'email', 1),
(13, 'en_UK', 0, 'Advertisement `[AD.TITLE]` is purchased on [SITE.NAME]!', 'ads-purchased', 'Order ID: [ORDER.ID]\n\nProduct ID: [PRODUCT.ID]\n\nFor any inconvenience please contact administrator of [SITE.NAME]\n\nClick here to visit [URL.AD]', 'drrrreams@gmail.com', '2015-11-30 15:53:50', 'email', 1),
(14, 'en_UK', 0, 'Receipt for [ORDER.DESC] #[ORDER.ID]', 'new-order', 'Hello [USER.NAME],Thanks for buying [ORDER.DESC].\n\nPlease complete the payment here [URL.CHECKOUT]', 'drrrreams@gmail.com', '2015-11-30 15:53:50', 'email', 1),
(15, 'en_UK', 0, 'Success! Your advertisement `[AD.NAME]` is created on [SITE.NAME]!', 'ads-confirm', 'Welcome [USER.NAME],\n\nThank you for creating an advertisement at [SITE.NAME]! \n\nPlease click on this link [URL.QL] to confirm it.\n\nRegards!', 'drrrreams@gmail.com', '2015-11-30 15:53:50', 'email', 1),
(16, 'en_UK', 0, 'Your ad [AD.NAME] has expired', 'ad-expired', 'Hello [USER.NAME],Your ad [AD.NAME] has expired \n\nPlease check your ad here [URL.EDITAD]', 'drrrreams@gmail.com', '2015-11-30 15:53:50', 'email', 1),
