(70, 'fr_FR', 0, 'Votre annonce sur [SITE.NAME] a été activée', 'ads-activated', 'Bonjour [USER.OWNER],\n\nNous vous informons que votre annonce [URL.QL] est activée!\nElle est désormais visible de tous.\n\nEn espérant ne vous avoir pas fait trop attendre.\n\nCordialement,', 'drrrreams@gmail.com', '2013-07-30 08:45:03', 'email', 1),
